		"text": "성폭행 혐의로 복역 중인 안희정 전 충남도지사의 모친상에 정치인들이 문상을 간 것을 두고 논란이 일고 있는 가운데, 누리꾼들은 피해자인 김지은씨의 책을 구매하는 방식으로 연대에 나섰다. 이 책은 각종 온라인서점 순위에서 ‘역주행’ 중이다.\nhttps://t.co/hvBkgYbomN"
