		"text": "그룹과 멤버와 관련된 소식을 협업툴로 체크하고 보며 리트윗, 공유하는 것이 담당자가 할 일인데 체크도 늦고 누락도 다수 되는 것을 보면... 스케줄을 직접 관리하는 소속사가 체킹하고 올리는 것이 더 빠르고 정확한 일인데 그러지 못하고 있다는 점."
