		"text": "❝ 공공기록물 관리에 관한 법률 시행령 등에는 “정보처리능력을 가진 장치에 의하여 전자적인 형태로 작성해 송신·수신 또는 저장되는 전자문서” 등으로 전자기록물을 정의하고 있지만 결재과정 등을 거친 전자문서를 수집대상으로 보고 있다."
